import React from 'react'

function Home() {
  return(
    <div className="main flex home-content">
      <div>
        <h1>Create your own color scheme!</h1>
        <p>Find the perfect color palette, or get inspired by the combinations you get here!</p>
      </div>
    </div>
  )
}

export default Home;
